def fib(n):
    if n < 2:
        return n
    # We can use dask.delayed and dask.compute to launch
    # computation from within tasks
    a = delayed(fib(n - 1))  # these calls are delayed
    b = delayed(fib(n - 2))
    #a, b = compute(a, b)  # execute both in parallel
    return a + b

